              buffer_in[c] = activation_high_6(buffer_out[c], norma_high);


            
  // Processing layer 7 

            for (c = 0; c < 35; ++c ) 
              buffer_out[c] = bias_7[c];

            for (c = 0; c < 35; ++c )
              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_7[i][c];

            norma_high = 0;

            // Prepares for next layer 
            for (c = 0; c < 35; ++c )
              buffer_in[c] = activation_high_7(buffer_out[c], norma_high);


            
  // Processing layer 8 

            for (c = 0; c < 35; ++c ) 
              buffer_out[c] = bias_8[c];

            for (c = 0; c < 35; ++c )
              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_8[i][c];

            norma_high = 0;

            // Prepares for next layer 
            for (c = 0; c < 35; ++c )
              buffer_in[c] = activation_high_8(buffer_out[c], norma_high);


            
  // Processing layer 9 

            for (c = 0; c < 35; ++c ) 
              buffer_out[c] = bias_9[c];

            for (c = 0; c < 35; ++c )
              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_9[i][c];

            norma_high = 0;

            // Prepares for next layer 
            for (c = 0; c < 35; ++c )
              buffer_in[c] = activation_high_9(buffer_out[c], norma_high);


            
  // Processing layer 10 

            for (c = 0; c < 3; ++c ) 
              buffer_out[c] = bias_10[c];

            for (c = 0; c < 3; ++c )
              for (i = 0; i < 35; ++i)
                buffer_out[c] += buffer_in[i] * kernel_10[i][c];

            norma_high = 0;

            for(c=0;c<3;++c)
              norma_high+=exp(buffer_out[c]);

            // Prepares for next layer 
            for (c = 0; c < 3; ++c )
              buffer_in[c] = activation_high_10(buffer_out[c], norma_high);


            

